import React from 'react';
import { Graphviz } from 'graphviz-react';

function RouteGraph({ route }) {
  const dotString = `
    digraph G {
      ${route.start} -> ${route.end} [label="${route.distanceInKm} km"];
    }
  `;

  return (
    <div>
      <h3>Graph for {route.start} to {route.end}</h3>
      <Graphviz dot={dotString} />
    </div>
  );
}

export default RouteGraph;
